import Header from "./components/Header";
import Search from "./components/Search";

const handleSearchSubmit = (e) => {
  e.preventDefault();
  console.log(e.target[0].value);
};

function App() {
  return (
    <div className="App">
      <Header tittle="Images Gallery" />
      <Search handleSubmit={handleSearchSubmit} />
    </div>
  );
}

export default App;
